import "./InterviewsContainerStyles.css";
import InterviewExcelLine from "../components/InterviewExcelLine";
import React from 'react'


const InterviewsContainer = () => {
    return (
        <div className="Container">
            <h1 className="Title">Your Interviews</h1>
            <ul className="ColumnNames">
                <li>Company</li>
                <li>Position</li>
                <li>Date</li>
                <li>Status</li>
                <li>Location</li>
                <li>Referral</li>
                <li>Referrer</li>
                <li>LinkedIn</li>
                <li>Notes</li>
            </ul>
            <InterviewExcelLine/>
            <InterviewExcelLine/>
        </div>
        
        );
};

export default InterviewsContainer;
